        return new Source("{% extends 'base.html.twig'%}
{% block title %}Création d'une annonce{% endblock %}

{# appel du template#}
{% form_theme form 'ad/_collection.html.twig' %}

{% block body %}
<h1 class=\"my-5\">Créer une nouvelle annonce</h1>

{{form_start(form)}}
<div class=\"row\">
    <div class=\"col\">
        <div class=\"alert alert-light\">
            <h2>Informations générales</h2>
            <hr>
            {{form_row(form.title)}}
            {{form_row(form.slug)}}
            {{form_row(form.price)}}
            {{form_row(form.rooms)}}
            
        </div>
        <div class=\"alert alert-light\">
            <h2>Détails de l'annonce</h2>
            <hr>
            {{form_row(form.introduction)}}
            {{form_row(form.content)}}
           
            
        </div>
    </div>
    <div class=\"col\">
        <div class=\"alert alert-light\">
            <h2>Image de l'annonce</h2>
            <hr>
            {{form_row(form.coverImage)}}
            {{form_row(form.images)}}
        </div>

    </div>
</div>

<div class=\"alert alert-success clearfix\">
    <h2 class=\"alert-heading\">Sauvegarder mon annonce</h2>
    <p>Vous êtes sur le point de créer votre annonce!</p>
</div>

<button type=\"submit\" class=\"btn btn-primary float-right\"><i class=\"fas fa-check\"></i></button>

{{form_end(form)}}
{% endblock %}

{% block javascripts %}
<script src=\"/js/ad.js\"></script>
{% endblock %}

